import React from "react";

function App() {
  const src = "https://media.w3.org/2010/05/sintel/trailer_hd.mp4 ";
  return (
    <div>
      <video controls width="100%" src={src} type="video/mp4" preload="auto" />
      <button id="play">play</button>
      <button id="pause">pause</button>
    </div>
  );
}

export default App;
